Changing an object to fit to an existing implementation. UDP Given that we have a method or an object (“ adapter client ”) expects another object to have a write method. def log(message, destination): destination.write(f"{message}") We want to write a message to a UDP socket using this. But UDP objects don't have this method. import socket
udp_socket = socket.socket(...)
udp_socket.send("hello", ...) So we write a class for this (“ adapter ”) that will have this send method. class UdpSocketAdapter: def __init__(self, ip, port): self._socket = socket.socket(socket.AF_INET, socket.SOCK_DGRAM) self._ip = ip self._port = port def write(self, message): self._socket.send(message, (self._ip, self._port)) Such that now udp_socket_adapter = UdpSocketAdapter()
log(message="hello", destination=udp_socket_adapter) Voltage difference The plug expects a recharge method. But the current voltage is too high. Given that we have class AdapterClient { fun main() { plug: HighVoltagePlug = HighVoltagePlug() plug.recharge() }
} We create a different plug that can adapt to this. class PlugAdapter implements Plug { fun recharge() { return 1 }
} And switch out accordingly. Kotlin: Extension functions as a means of adapting an existing class While Kotlin's extension functions can be seen as adapting a class to a new interface, it's not the Adapter pattern in the strict sense because there's no separate adapter class involved. However, it achieves a similar goal of adapting an existing class to a new interface. Given an existing class String, we want to adapt it to append an exclamation mark to it fun addExclamation(string: String): String { return "$string!"
} so we do fun String.addExclamation(): String { return "$this!"
}

